import React from "react";
import styled from "styled-components";

const Conteiner = styled.div`
  top: 32px;
  margin-bottom: 20px;
  background-color: red;
  height: 300px;
`;
export default function PersonPage() {
  return <Conteiner>PersonPage</Conteiner>;
}
